import { Route, Switch, Redirect } from 'react-router-dom';
import MainNavigation from './components/layout/MainNavigation';
import About from './pages/About';
import Home from './pages/Home';

function App() {
  return (
    <MainNavigation>
      <Switch>
      <Route path='/' exact >
          <Redirect to='/home' />
      </Route>
      <Route path='/home'>
        <Home />
      </Route>
      <Route path='/About' >
        <About />
      </Route>
      </Switch>
    </MainNavigation>
  );
}

export default App;
